       <BrowserRouter>
       <div>
        <Menu />       
            <Switch>
             <Route path="/" component={Home} exact/>
             <Route path="/contact" component={Contact}/>
           </Switch>
        </div> 
      <Footer />
      </BrowserRouter>

    );
  }
}

export default App;
